import React from 'react';
import './title.css';

class TitleContainer extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            title: "Tue, tue",
            subtitle: "From Ghana",
        }
    }
    render() {
        return React.createElement(
            'div', { className: "title", value: this.state.title},
            this.state.title,
            React.createElement(
                'div', { className: "subtitle", value: this.state.subtitle },
                this.state.subtitle
            )
        );
    }
}

export default TitleContainer;
